import { Component, OnInit } from '@angular/core';
import { CurrentWeather } from 'src/app/models/meteo';
import { ServiceMeteoService } from 'src/app/services/service-meteo.service';

@Component({
  selector: 'app-meteo-actuelle',
  templateUrl: './meteo-actuelle.component.html',
  styleUrls: ['./meteo-actuelle.component.css']
})
export class MeteoActuelleComponent implements OnInit {

  public currentWeather!:CurrentWeather;

  constructor(private meteoService:ServiceMeteoService){}

    ngOnInit(): void {
      console.warn(this.meteoService.getPrevisionsMeteo(50,50));
      this.meteoService.getPrevisionsMeteo(50,50).subscribe(res => {
        console.warn(res)
      });
  }
}
<div class="min-h-screen flex items-center justify-center bg-gray-100">
  <div class="max-w-md w-full bg-white p-8 rounded-lg shadow-md">
    <h2 class="text-2xl font-semibold mb-4">Météo du jours</h2>
    <div class="flex items-center justify-between mb-4">
      <div class="flex items-center">
        <img class="w-12 h-12 mr-2" src="https://example.com/weather-icon.png" alt="Weather Icon">
        <h3 class="text-xl font-semibold">Paris</h3>
      </div>
      <div>
        <span class="text-4xl font-semibold">15°C</span>
      </div>
    </div>
    <div class="mb-4">
      <span class="text-gray-500">Soleil avec quelques nuages</span>
    </div>
    <div class="flex items-center justify-between">
      <div>
        <span class="text-gray-500">Humidité</span>
        <span class="text-lg font-semibold">60%</span>
      </div>
      <div>
        <span class="text-gray-500">Vent</span>
        <span class="text-lg font-semibold">15 km/h</span>
      </div>
      <div>
        <span class="text-gray-500">Pression</span>
        <span class="text-lg font-semibold">1015 hPa</span>
      </div>
    </div>
  </div>
</div>
